function createTable() {
    var dbc = this.get('DatabaseConnector');
    var sql = 'CREATE TABLE ' + 
        this.get('TableName').textString + ' (';
    var that = this;
    this.get('Grid').getDataObjects().forEach(function (ea) {
            sql += ea['Name'] + ' ' + ea['Type'] + ',';
        });
    sql = sql.substring(0, sql.length -1); // remove last ','
    sql += ');';
    dbc.exec(sql);
}
